  const error = useRouteError();
  console.error(error);

  return (
    <div className={stytles.error - page}>
      <h1>Siamo Spiacenti</h1>
      <p>La pagina richiesta non esiste!</p>
      <p>
        <i>{error.statusText || error.message}</i>
      </p>
    </div>
  );
}
